	add("hemicrania", "{\"term\":\"hemicrania\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027hemicrania\u0027 (pain in one half of the head) from Ancient greek (to 1453) \u0027ἡμικρᾱνίᾰ\u0027 () from \u0027ἡμι-\u0027 (hemi-, half) + \u0027κρανίον\u0027 (skull) (from whence also \u0027\u0027 .Cognate to \u0027\u0027 and \u0027\u0027 which also derive from the Latin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A headache affecting one side of the head\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993,\u0027\u0027 , by , translation Burgin and O’Connor, Chapter 2, [http://books.google.com/books?id\u003d_WYWW7smmzUC\u0026amp;lpg\u003dPA17 p. 17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“Gods, gods, why do you punish me? Yes, no doubt it is upon me again, again this terrible, invincible affliction … this \u0027\u0027hemicrania\u0027\u0027 which grips half the head with pain … without remedy, without escape … I must try not to move my head. …”\u0027 \u0026lt;!-- quote marks in original --\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

