	add("hemione", "{\"term\":\"hemione\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|hēmionus}}, from Ancient greek (to 1453) {{m|grc|ἡμῐ́ονος||half ass, mule}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An onager, an individual \u0027Equus hemionus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027 September, Edouard L. Troussart, \u0027Wild Horses\u0027, \u0027w:Popular Popular Science\u0027, [http://books.google.com.au/books?id\u003dfyIDAAAAMBAJ\u0026amp;pg\u003dPA627\u0026amp;dq\u003d%22hemione%22%7C%22hemiones%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dc9rrUYWfPILyiAfft4H4DQ\u0026amp;ved\u003d0CDcQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hemione%22%7C%22hemiones%22\u0026amp;f\u003dfalse page 627\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Its head is large, with ears smaller than those of the \u0027\u0027hemione\u0027\u0027, the shoulders thick, especially in the male, the limbs robust and stubbier than those of the \u0027\u0027hemiones\u0027\u0027 and the asses\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Augusto Azzaroli, \u0027An Early History of Horsemanship\u0027, [http://books.google.com.au/books?id\u003dKvEUAAAAIAAJ\u0026amp;pg\u003dPA24\u0026amp;dq\u003d%22hemione%22%7C%22hemiones%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dc9rrUYWfPILyiAfft4H4DQ\u0026amp;ved\u003d0CGQQ6AEwC\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hemione%22%7C%22hemiones%22\u0026amp;f\u003dfalse page 24\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They presumably belong to \u0027\u0027hemiones\u0027\u0027 (\u0027\u0027hemiones\u0027\u0027 were actually recorded from the same level at Rana Gundhai) and, in spite of some optimistic statements to the contrary, it is sometimes impossible to distinguish horses fom \u0027\u0027hemiones\u0027\u0027 on isolated teeth alone\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, C. P. Groves, O. A. Ryder, \u0027Systematics and Phylogeny of the Horse\u0027, Ann T. Bowling, Anatoly Ruvinsky (editors), \u0027The Genetics of the Horse\u0027, [http://books.google.com.au/books?id\u003dZL3A097IbjsC\u0026amp;pg\u003dPA11\u0026amp;dq\u003d%22hemione%22%7C%22hemiones%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dc9rrUYWfPILyiAfft4H4DQ\u0026amp;ved\u003d0CEAQ6AEwA\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hemione%22%7C%22hemiones%22\u0026amp;f\u003dfalse page 11\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Another possible area of disagreement is that asses and \u0027\u0027hemiones\u0027\u0027 are associated unequivocally in the morphological tree, but less definitely in the genetic tree: whether \u0027\u0027hemiones\u0027\u0027 and African (\u0027true\u0027) wild asses are more closely related to horses or whether they are most closely related to each other and form a separate lineage has yet to be resolved unequivocally by the DNA data, and note that in the morphological data they are united by only a single derived condition (Fig. 1.1\", \"priority\":10}]}, \"synonyms\":{}}");

