	add("hemisphere", "{\"term\":\"hemisphere\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027hemisphaerium\u0027 from Ancient greek (to 1453) \u0027ἡμισφαίριον\u0027 () from \u0027ἡμι-\u0027 (half) + \u0027σφαῖρα\u0027 (sphere)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Half of the celestial sphere, as divided by either the ecliptic or the celestial equator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A realm or domain of activity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Half of the Earth, such as the Northern Hemisphere, Southern Hemisphere, Western Hemisphere or Eastern Hemisphere, Land Hemisphere, Water Hemisphere etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any half-sphere, formed by a plane intersecting the center of a sphere\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A map or projection of a celestial or terrestrial hemisphere\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Either of the two halves of the cerebrum\", \"priority\":6}]}, \"synonyms\":{}}");

